	add("thalience", "{\"term\":\"thalience\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\": The concept was invented by Karl Schroeder in his novel \u0027Ventus\u0027 (2000) and has been adopted by some members of the artificial intelligence community to describe the self-organizing properties of fine-grained distributed networks. The novel states that the word was deliberately chosen as an allusion to \u0026quot;silent Thalia\u0026quot;, the muse of Nature. Entities are considered \u0026quot;thalient\u0026quot; if they succeed in developing their own categories for understanding the world.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being thalient: the idea that every object should know what and where it is, and should be able to report that to every nearby object\", \"priority\":1}]}, \"synonyms\":{}}");

