	add("thallophyte", "{\"term\":\"thallophyte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"multiple languages\"], \"text\":\"From Multiple languages {{taxlink|Thallophyta|division|noshow\u003d1}}. Surface reading of {{suffix|thallus|phyte|t2\u003dplant|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of very many primitive plants that consist of a thallus (plant body not differentiated into roots, stems and leaves), formerly collected in the obsolete taxonomic group Thallophyta\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Estrelita A. Madriaga, Anthony Lee, Felicitas B. Ventura, Orlando A. Oronce (coordinator), \u0027Biology: Science and Technology II\u0027, [http://books.google.com.au/books?id\u003dHPCEK9ZVmEQC\u0026amp;pg\u003dPA347\u0026amp;dq\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deXb4Uv6NDon4lAXcq4D4CQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;f\u003dfalse page 347\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They\u0026lt;sup\u0026gt;[algae, fungi and mosses]\u0026lt;/sup\u0026gt; lack the vascular tissues; thus, they are called \u0027\u0027thallophytes\u0027\u0027. Algae are \u0027\u0027thallophytes\u0027\u0027 with chlorophyll.Fungi are \u0027\u0027thallophytes\u0027\u0027 without chlorophyll\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Pat E. Rasmussen, \u0027Chapter IV.5: Mercury in Vegetation of the Precambrian Shield\u0027, Carl J. Watras, John W. Huckabee (editors), \u0027Mercury Pollution: Integration and Synthesis\u0027, [http://books.google.com.au/books?id\u003dOO0qtznwupcC\u0026amp;pg\u003dPA422\u0026amp;dq\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deXb4Uv6NDon4lAXcq4D4CQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;f\u003dfalse page 422\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In general, the usefulness of the \u0027\u0027thallophytes\u0027\u0027 as Hg bioindicators was limited by their sporadic occurrence in the forest environment. Because of the importance of the \u0027\u0027thallophytes\u0027\u0027 as components of the food chain, however, several samples from different groups (summarized in Table 2) were collected for comparison with values reported in the literature\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, R. G. Hermann, \u0027The Chloroplast: Part of the Integrated Genetic System of the Plant Cell\u0027, Joan H. Argyroudi-Akoyunoglou, Horst Senger (editors), \u0027The Chloroplast: From Molecular Biology to Biotechnology\u0027, [http://books.google.com.au/books?id\u003dVbGPXMcvWhgC\u0026amp;pg\u003dPA66\u0026amp;dq\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deXb4Uv6NDon4lAXcq4D4CQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;f\u003dfalse page 66\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Fossile records along with molecular, cytological and morphological phylogenetic work favour a single origin of land plants from charophycean \u0027\u0027thallophytes\u0027\u0027, and indicate that several major lineages of vascular plants had evolved more than 400 million years ago\", \"priority\":10}]}, \"synonyms\":{}}");

