	add("thanks", "{\"term\":\"thanks\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"saterfriesisch\"], \"text\":\"From Middle english (1100-1500) {{m|enm|thanken}}, {{m|enm|thankien}}, from Old english (ca. 450-1100) {{m|ang|þancian}}, {{m|ang|þoncian||to thank, give thanks}}, from Proto-germanic {{m|gem-pro|*þankōną||to thank}}, from Proto-germanic {{m|gem-pro|*þankaz||thought, gratitude}}, from Proto-indo-european {{m|ine-pro|*teng-||to think, feel}}. Cognate with Saterfriesisch {{m|stq|tonkje||to thank}}, West frisian {{m|fy|tanke||to thank}}, Dutch {{m|nl|danken||to thank}}, Low German {{m|nds|danken||to thank}}, German {{m|de|danken||to thank}}, Danish {{m|da|takke||to thank}}, Swedish {{m|sv|tacka||to thank}}, Icelandic {{m|is|þakka||to thank}}. Related to {{l/en|thought}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An expression of gratitude\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"After all I’ve done, a simple acknowledgment is all the \u0027\u0027thanks\u0027\u0027 I get\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Grateful feelings or thoughts\", \"priority\":3}]}, \"synonyms\":{}}");

	add("thanksgiving", "{\"term\":\"thanksgiving\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|thanks|giving|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an expression of gratitude\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, w:The Land That Time Forgot The Land That Time Forgot Chapter I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The waters grew suddenly lighter, and my spirits rose accordingly. I shouted down to those below that I saw daylight ahead, and a great shout of \u0027\u0027thanksgiving\u0027\u0027 reverberated through the ship. A moment later we emerged into sunlit water, and immediately I raised the periscope and looked about me upon the strangest landscape I had ever seen\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a short prayer said at meals; grace, a benediction\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A public celebration in acknowledgement of divine favour\", \"priority\":5}]}, \"synonyms\":{}}");

